import React from 'react'
import Button from 'react-bootstrap/Button'

const MyButton = () => {
    return (
        <div>
            <ReactBootstrap.Button bsClass="custom-btn">Custom Button</ReactBootstrap.Button>
        </div>
    )
}

export default MyButton
